function string_to_key(letter)
{
    switch(letter)
    {
        case("A"):
            return 0;
            break;
        case("Z"):
            return 1;
            break;
        case("E"):
            return 2;
            break;
        case("R"):
            return 3;
            break;
        case("T"):
            return 4;
            break;
        case("Y"):
            return 5;
            break;
        case("U"):
            return 6;
            break;
        case("I"):
            return 7;
            break;
        case("O"):
            return 8;
            break;
        case("P"):
            return 9;
            break;
        case("Q"):
            return 10;
            break;
        case("S"):
            return 11;
            break;
        case("D"):
            return 12;
            break;
        case("F"):
            return 13;
            break;
        case("G"):
            return 14;
            break;
        case("H"):
            return 15;
            break;
        case("J"):
            return 16;
            break;
        case("K"):
            return 17;
            break;
        case("L"):
            return 18;
            break;
        case("M"):
            return 19;
            break;
        case("BACK"):
            return 20;
            break;
        case("W"):
            return 21;
            break;
        case("X"):
            return 22;
            break;
        case("C"):
            return 23;
            break;
        case("V"):
            return 24;
            break;
        case("B"):
            return 25;
            break;
        case("N"):
            return 26;
            break;
        default:
            return 27;
    }
} // function string_to_key(string letter) -> int



